//Quand vous recevez cette carte,//|+2 Coffres|.";Ie.SWASHBUCKLER="|+3 Cartes|////Si votre défausse n'est pas vide ://|+1 Coffres|, puis si vous avez au//moins 4 jetons sur vos Coffres,//prenez le Coffre au trésor.";Ie.TREASURER="|+[3]|////Choisisez une option : écartez//une carte Trésor de votre main;//ou recevez en main une carte//Trésor du Rebut; ou prenez la Clé.";Ie.VILLAIN="|+2 Coffres|////Tous vos adversaires ayant au//moins 5 cartes en main défaussent//une carte coûtant [2] ou plus (ou//à défaut, dévoilent leur main).";Ie.CATHEDRAL="Au début de votre tour,//écartez une carte de votre main.";Ie.CITYGATE="Au début de votre tour, |+1 Carte|, puis replacez//une carte de votre main sur votre pioche.";Ie.PAGEANT="À la fin de votre phase Achat, vous pouvez//payer [1] pour |+1 Coffres|.";Ie.SEWERS="Quand vous écartez une carte autrement que par ceci,//vous pouvez écarter une carte de votre main.";Ie.STARCHART="Quand vous mélangez, vous pouvez choisir//quelle carte vous mettez en haut.";Ie.EXPLORATION="À la fin de votre phase Achat, si vous n'avez pas reçu//de carte pendant celle-ci, |+1 Coffres| et |+1 Villageois|.";Ie.FAIR="Au début de votre tour, |+1 Achat|.";Ie.SILOS="Au début de votre tour, défaussez autant de Cuivres que//souhaité, dévoilés, et piochez le même nombre de cartes.";Ie.SINISTERPLOT="Au début de votre tour, ajoutez un jeton ici, ou//retirez tous vos jetons pour |+1 Carte| chacun.";Ie.ACADEMY="Quand vous recevez une carte Action,//|+1 Villageois|.";Ie.CAPITALISM="Pendant vos tours, les cartes Action ayant dans leur//texte un montant « +[]» sont aussi des Trésors.";Ie.FLEET="Après que la partie est finie, les joueurs ayant//un cube ici jouent un tour supplémentaire.";Ie.GUILDHALL="Quand vous recevez un Trésor, |+1 Coffres|.";Ie.PIAZZA="Au début de votre tour, dévoilez la carte du haut//de votre pioche. Si c'est une carte Action, jouez-la.";Ie.ROADNETWORK="Quand un autre joueur reçoit une carte Victoire,//|+1 Carte|.";Ie.BARRACKS="Au début de votre tour, |+1 Action|.";Ie.CROPROTATION="Au début de votre tour, vous pouvez défausser//une carte Victoire pour |+2 Cartes|.";Ie.INNOVATION="Une fois à chacun de vos tours, quand vous//recevez une carte Action, vous pouvez la jouer.";Ie.CANAL="Pendant vos tours, les cartes coûtent [1] de moins.";Ie.CITADEL="À chacun de vos tours, la première fois que vous//jouez une carte Action, rejouez-la ensuite.";Ie.FLAG="Quand vous piochez votre main, |+1 Carte|.";Ie.HORN="Une fois par tour, quand vous défaussez une Garde-frontière//de la zone de jeu, vous pouvez la replacer sur votre pioche.";Ie.KEY="Au début de votre tour, |+|[1].";Ie.LANTERN="Les Gardes-frontières que vous jouez dévoilent 3 cartes et en//défaussent 2. Il faut dévoiler 3 cartes Action pour prendre la Corne.";Ie.TREASURECHEST="Au début de votre phase Achat, recevez un Or.";const jt={};jt.SAUNA="|+1 Carte|//|+1 Action|////Vous pouvez jouer un Trou dans//la glace de votre main.////À ce tour, quand vous jouez//un Argent, vous pouvez écarter//une carte de votre main.";jt.AVANTO="|+3 Cartes|//////Vous pouvez jouer un Sauna//de votre main.";jt.BLACKMARKET="|+[2]|////Dévoilez les 3 premières cartes//du paquet du Marché noir. Jouez//autant de cartes Trésor de votre main//que souhaité. Vous pouvez acheter//une des cartes dévoilées. Replacez//les autres sous le paquet Marché noir//dans l'ordre de votre choix.//---//Mise en place : préparez le paquet//du Marché noir avec des cartes Royaume//différentes non utilisées.";jt.ENVOY="Dévoilez les 5 premières cartes de//votre pioche. Le joueur à votre//gauche en choisit une. Défaussez-la//et prenez les autres en main.";jt.GOVERNOR="|+1 Action|////Choisissez (vous obtenez la version//entre parenthèses) : tous les joueurs//obtiennent |+1 (+3) Cartes|; ou tous les//joueurs reçoivent un Argent (Or); ou//tous les joueurs peuvent écarter une//carte de leur main pour recevoir une//carte coûtant exactement [1]([2]) de plus.";jt.PRINCE="Vous pouvez mettre de côté//sur cette carte une carte Act